<!DOCTYPE html>
<html lang="en">
	<head>
		<meta charset="utf-8">
		<meta name="viewport" content="width=device-width,initial-scale=1">
		<title>VoltaTECH - Corroded Proxy</title>
		<link rel="preconnect" href="https://fonts.gstatic.com">
		<link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;600;700&display=swap" rel="stylesheet">
		<style>
			:root{
				--bg:#0f1113;
				--card:#131516;
				--muted:#9aa5ad;
				--accent:#3AE474;
				--glass:rgba(255,255,255,0.03);
			}

			*{box-sizing:border-box}
			html,body{height:100%}
			body{
				margin:0;
				font-family:Inter, system-ui, -apple-system, 'Segoe UI', Roboto, 'Helvetica Neue', Arial;
				background:linear-gradient(180deg,#071014 0%, #0e1113 60%);
				color:#e6eef1;
				-webkit-font-smoothing:antialiased;
				display:flex;
				align-items:center;
				justify-content:center;
				padding:32px;
			}

			.container{
				width:100%;
				max-width:820px;
				background:linear-gradient(180deg, rgba(255,255,255,0.02), rgba(255,255,255,0.01));
				border:1px solid rgba(255,255,255,0.04);
				border-radius:14px;
				padding:36px;
				box-shadow:0 8px 30px rgba(2,6,10,0.6);
				backdrop-filter:blur(6px);
			}

			header{
				display:flex;
				align-items:center;
				gap:16px;
				margin-bottom:18px;
			}

			.logo{
				width:56px; height:56px;
				border-radius:10px;
				display:flex; align-items:center; justify-content:center;
				overflow:hidden;
				box-shadow:0 6px 18px rgba(58,228,116,0.12), inset 0 -4px 10px rgba(0,0,0,0.25);
			}
			.logo img{
				width:110%;
				height:110%;
				object-fit:cover;
				display:block;
				border-radius:inherit;
			}

			h1{font-size:20px;margin:0;font-weight:600}
			p.lead{margin:6px 0 0;color:var(--muted);font-size:13px}

			.form{
				display:flex; gap:12px; margin-top:22px; align-items:center;
			}

			input[type="text"], input[type="search"], input[id="url"]{
				flex:1;
				padding:14px 16px;
				font-size:15px;
				border-radius:10px;
				border:1px solid rgba(255,255,255,0.04);
				background:var(--glass);
				color:var(--accent);
				outline:none;
				transition:box-shadow .18s ease, transform .12s ease;
			}

			input::placeholder{color:rgba(234,234,234,0.2);}

			input[type="button"], input[type="submit"], .btn{
				padding:12px 18px;
				border-radius:10px;
				border: none;
				background: linear-gradient(180deg,var(--accent), #28c36a);
				color:#042018;
				font-weight:700;
				cursor:pointer;
				box-shadow:0 8px 20px rgba(58,228,116,0.12);
				transition:transform .12s ease, box-shadow .12s ease, opacity .12s ease;
			}

			input[type="button"]:active, .btn:active{transform:translateY(1px)}
			input[type="button"]:hover, .btn:hover{opacity:.95}

			.meta{display:flex;gap:12px;align-items:center;margin-top:18px;justify-content:space-between}
			.links a{color:var(--muted);text-decoration:none;font-size:13px}
			.links a.github{color:var(--muted)}

			@media (max-width:560px){
				.container{padding:20px}
				.form{flex-direction:column;align-items:stretch}
				input[type="button"]{width:100%}
			}
		</style>
	</head>

				<div>
					<h1>Corroded Proxy</h1>
					<p class="lead">Enter a URL below to open it through the proxy (https:// will be added automatically).</p>
				</div>
			</header>

			<div class="form">
				<input id="url" name="url" type="search" placeholder="example.com, http://example.com or, https://example.com" aria-label="URL input">
				<input id="go" class="btn" type="button" value="Open">
			</div>

			<div class="meta">
				<div class="links"><a class="github" href="https://github.com/Voltarian-Dev-Team/CorrodedProxy" target="_blank" rel="noopener">View project on GitHub</a></div>
			</div>
		</div>

		<script>
			function xor(str) {
				return encodeURIComponent(str.toString().split('').map((char, ind) => ind % 2 ? String.fromCharCode(char.charCodeAt() ^ 2) : char).join(''));
			}
			
			var prUrl = document.getElementById("url"),
			prGo = document.getElementById("go");
			
			function go(url) {
				window.location.href = "c/" + xor(/^(http:\/\/|https:\/\/)/i.test(url) ? url : "https://" + url);
			}
			
			prUrl.addEventListener("keydown", function(e) {
				if (e.code == "Enter" && prUrl.value) go(prUrl.value);
			}, false);
			
			prGo.addEventListener("click", function() {
				if (prUrl.value) go(prUrl.value);
			}, false);
		</script>
	</body>
